import styled from 'styled-components';

const ConfirmButtonsWrapper = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-column-gap: 1.6rem;
  width: 100%;
`;

export default ConfirmButtonsWrapper;
